import {Router} from "express";

import {createNewProduct, getProducts, getProductById, deleteProductById, getTotalProducts, updateProductById, paginaweb, Registro, Crear} from "../controllers/products.controller";

const router = Router();

router.get("/Index", paginaweb);

router.get("/Crear", Crear);

//esto es para guardar a nuevos usuarios con formulario
router.get("/CrearUsuario", Crear);

router.get("/Register", Registro);

router.get("/products", getProducts);

router.post("/products", createNewProduct);

router.get("/products/count", getTotalProducts);

router.get("/products/:idAlum", getProductById);

router.delete("/products/:idAlum", deleteProductById);

router.put("/products:idAlum", updateProductById);

export default router;

