import bcryptjs from "bcryptjs";
import { getConnection, querys, sql } from "../database";


export const paginaweb = async (req, res) => {
    req.session.my_variable = 'hello word';
    res.render('index');
    };

    //Ruta para crear los registros de usuarios desde adentro
export const Crear = async (req, res) => {
    res.render('Crear');
    };

export const Registro = async (req, res) => {
    res.send('Recivido');
    };
    

export const getProducts = async (req, res) => {
    try {
        const pool = await getConnection();
        const result = await pool.request().query(querys.getAllproduct);
        res.json(result.recordset);
       } catch (error) {
          res.status(500);
          res.send(error.message); 
       }
};

export const createNewProduct = async (req, res) => {
    const { Nombre, ApellidoPa, ApellidoMa, Direccion, Fechanac, Sexo, idcarrera1 } = req.body;

    //validacion
    if (Nombre == null || ApellidoPa == null || ApellidoMa == null || Direccion == null || Fechanac == null || Sexo == null || idcarrera1 == null) {
        return res.status(400).json({ msg: "Bad Request. Plase Fill all fields"});
    }

   try {
    const pool = await getConnection();

    await pool
        .request()
        .input("Nombre", sql.VarChar, Nombre)
        .input("ApellidoPa", sql.VarChar, ApellidoPa) 
        .input("ApellidoMa", sql.VarChar, ApellidoMa)
        .input("Direccion", sql.Text, Direccion)
        .input("Fechanac", sql.DateTime, Fechanac)
        .input("Sexo", sql.Char, Sexo)
        .input("idcarrera1", sql.Int, idcarrera1)
        .query(querys.addNewProduct);

    res.json({ Nombre, ApellidoPa, ApellidoMa, Direccion, Fechanac, Sexo, idcarrera1 });
   } catch (error) {
    res.status(500);
    res.send(error.message);
   }
};

export const getProductById = async (req, res) => {
    const {idAlum} = req.params;    
    const pool = await getConnection();
        const result = await pool
          .request()
          .input("idAlum", req.params.idAlum)
          .query(querys.getProducById);
        res.json(result.recordset[0]);
    };

export const deleteProductById = async (req, res) => {
    const {idAlum} = req.params;    
    const pool = await getConnection();
        const result = await pool
            .request()
            .input("idAlum", req.params.idAlum)
            .query(querys.deleteProduct);
        res.send(result);
};

export const getTotalProducts = async (req, res) => {    
    const pool = await getConnection();
    const result = await pool
        .request()
        .query(querys.getTotalProducts);
    res.json(result.recordset[0][''])
};

export const updateProductById = async (req, res) => {    
    const { Nombre, ApellidoPa, ApellidoMa, Direccion, Fechanac, Sexo, idcarrera1 } = req.body;
    const {idAlum} = req.params; 
    //validacion
    if (Nombre == null || ApellidoPa == null || ApellidoMa == null || Direccion == null || Fechanac == null || Sexo == null || idcarrera1 == null) {
        return res.status(400).json({ msg: "Bad Request. Plase Fill all fields"});
    }

    const pool = await getConnection();
    await pool.request()
    .input("Nombre", sql.VarChar, Nombre)
    .input("ApellidoPa", sql.VarChar, ApellidoPa) 
    .input("ApellidoMa", sql.VarChar, ApellidoMa)
    .input("Direccion", sql.Text, Direccion)
    .input("Fechanac", sql.DateTime, Fechanac)
    .input("Sexo", sql.Char, Sexo)
    .input("idcarrera1", sql.Int, idcarrera1)
    .input("idAlum", sql.Int, MatriAlum)
    .query(querys.uptdateProductById);

res.json({Nombre, ApellidoPa, ApellidoMa, Direccion, Fechanac, Sexo, idcarrera1});
};

