            alertTitle: "Error",
            alertMessage: "¡No se puede dejar los campos vacios!",
            alertIcon: 'error',
            showConfirmButton:false,
            timer:2500,
            ruta:''
        });
    }else if (Password !== Password2) {
        return res.sendStatus(300);
